import React, { useState } from 'react';
import "./TradeForm.css";

const TradeForm = () => {

    const [enteredName, setEnteredName ] = useState('');
    const [enteredTicker, setEnteredTicker ] = useState('');
    const [enteredAmount, setEnteredAmount ] = useState('');
    const [enteredDate, setEnteredDate ] = useState('');

    const nameChangeHandler = (event) => {
        setEnteredName(event.target.value);
};
    const tickerhangeHandler = (event) => {
        setEnteredTicker(event.target.value);
};
    const amountChangeHandler = (event) => {
        setEnteredAmount(event.target.value);
};
    const dateChangeHandler = (event) => {
        setEnteredDate(event.target.value);
};

  return <form>
    <div className="new-trade__controls">
        <div className="new-trade__control">
            <label>Name</label>
            <input type="text" onChange={setEnteredName} />
        </div>
        <div className="new-trade__control">
            <label>Ticker</label>
            <input type="text" onChange={setEnteredTicker} />
        </div>
        <div className="new-trade__control">
            <label>Amount</label>
            <input type="number" min='0.01' step='0.01' onChange={setEnteredAmount}/>
        </div>
        <div className="new-trade__control">
            <label>Date</label>
            <input type="date" min='2023-01-01' step='2024-12-25' onChange={setEnteredDate} />
        </div>
    </div>
    <div className="new-trade__actions">
        <button type="submit">Add Trade</button>
    </div>
  </form>;
};

export default TradeForm;
